in_source: |-
  (begin
      (setq n input)
      (setq i 0)
      (setq sum 0)
      (setq sum2 0)
      (while (<= i n)
          (setq sum (+ sum i))
          (setq sum2 (+ sum2 (* i i)))
          (setq i (+ i 1))
      )
      (setq sum (* sum sum))
      (setq res (- sum sum2))
      (print res)
  )
